// Generated by BUCKLESCRIPT, PLEASE EDIT WITH CARE
'use strict';

var DateFns = require("../../shared/utils/DateFns.bs.js");

function id(t) {
  return t.id;
}

function title(t) {
  return t.title;
}

function createdAt(t) {
  return t.createdAt;
}

function repliesCount(t) {
  return t.repliesCount;
}

function makeFromJs(jsObject) {
  return {
          id: jsObject.id,
          title: jsObject.title,
          createdAt: DateFns.decodeISO(jsObject.createdAt),
          repliesCount: jsObject.repliesCount
        };
}

exports.id = id;
exports.title = title;
exports.createdAt = createdAt;
exports.repliesCount = repliesCount;
exports.makeFromJs = makeFromJs;
/* DateFns Not a pure module */
